import { Component } from '@angular/core';
import { RegionsComponent } from '../player-option/regions/regions.component';
import { PokemonService } from '../_services/pokemon/pokemon.service';

@Component({
  selector: 'app-new-game',
  templateUrl: './new-game.component.html',
  styleUrls: ['./new-game.component.scss']
})
export class NewGameComponent extends RegionsComponent{
  constructor(http: PokemonService, getRegion) {
    super(http)
  }
  playerPokemons: any
  this.getRegion('kanto')
}
